import React from 'react';
import './Header.css';
import SearchIcon from "@material-ui/icons/Search";
import HomeIcon from "@material-ui/icons/Home";
import FlagIcon from "@material-ui/icons/Flag";
import SubscriptionsOutLinedIcon from 
"@material-ui/icons/SubscriptionsOutlined";
import StorefrontOutLinedIcon from 
"@material-ui/icons/StorefrontOutlined";

function Header() {
    return (
        <div className='header'>
            <div className="header__left">
                <img 
                src="https://upload.wikimedia.org/
                wikipedia/commons/5/51/
                Facebook_f_logo_%282019%29.svg" alt=""
                />
                <div className="header__input">
                    <SearchIcon />
                    <input type="text"/>
                </div>
            </div>

            <div className="header__middle">
                <div className="header__option">
                    <HomeIcon fontSize="large"/>
                </div>
            </div>

            <div className="header__right"></div>
    </div>
    );
}

//rcfe extension = es7
export default Header
